import React from "react";
import "./skills.css";

const Skills = () => {
  this.state = {
    languageData: [{ label: "C", value: 90 }, 
    {label:'Javascript', value:85},],
  };
  return (
    <div class="skills" id="skills">
      <h1>Skills</h1>
    </div>
  );
};

export default Skills;
